import React from 'react';
import Navbar from './Navbar';

const Transaction = ({ selectedItems, checkoutCompleted }) => {
  // Sample transaction data
  const staticTransactionData = [
    {
      id: 1,
      name: 'Sample Item 1',
      points: 50,
    },
    {
      id: 2,
      name: 'Sample Item 2',
      points: 75,
    },
  ];

  // Static data to display
  const staticData = [
    {
      id: 3,
      name: 'Static Item 1',
      points: 30,
    },
    {
      id: 4,
      name: 'Static Item 2',
      points: 60,
    },
  ];

  return (
    <div>
      <Navbar />
      <div className="divcss">
        <h2>Transaction page</h2>
        <h3>Checkout History</h3>
        {checkoutCompleted ? (
          <div className="transaction-details">
            <h4>Selected Items:</h4>
            <ul>
              {selectedItems.map((item) => (
                <li key={item.id}>
                  {item.name} - {item.points} Points
                </li>
              ))}
            </ul>
            <h4>Checkout History:</h4>
            <table className="checkout-history-table">
              <thead>
                <tr>
                  <th>Item Name</th>
                  <th>Points</th>
                </tr>
              </thead>
              <tbody>
                {staticTransactionData.map((transaction) => (
                  <tr key={transaction.id}>
                    <td>{transaction.name}</td>
                    <td>{transaction.points} Points</td>
                  </tr>
                ))}
              </tbody>
            </table>
            <h4>Additional Static Data:</h4>
            <ul>
              {staticData.map((item) => (
                <li key={item.id}>
                  {item.name} - {item.points} Points
                </li>
              ))}
            </ul>
          </div>
        ) : (
          <p>No checkout history available.</p>
        )}
      </div>
    </div>
  );
};

export default Transaction;
